  "handle": "huft-made-to-order-festive-tuxedo-dog-harness",
  "description": "<p><span style=\"font-weight: 400;\">Special occasions call for special outfits for your dog. Dress him up to impress the crowd at parties or on a date night with the HUFT Made To Order Navy Blue Tuxedo Harness.</span></p>\n<p><span style=\"font-weight: 400;\">The white shirt is made of Satin while the coat is made of Polyester. The brown bow tie attached gives the harness a more formal look. The classic cut ensures that the harness fits your dog perfectly and does not compromise mobility or comfort. To complement the charming look, the harness has a gold coloured D ring.</span></p>\n<div>\n<strong>Features:</strong><br>\n<div data-mce-fragment=\"1\">\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">The shirt is made of Satin and coat is made of Polyester</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Comes with a cute, brown bow tie</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Easy to wear and adjust</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Posh gold D ring for leash attachment</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Made to order<strong> (Sizes Can be customised according to the pet's measurements)</strong></span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Golden HUFT branding in front</span></li>\n</ul>\n</div>\n</div>\n<p><b>Care Instructions:</b></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Hand wash separately in cold water with mild detergent</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Do not tumble dry</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Do not wring</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Hang dry in shade</span></li>\n</ul>\n<p><strong>HUFT Tip:</strong></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Not recommended for strong pullers</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Not recommended for outdoor walks</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">We recommend pet parental supervision when pets are wearing harnesses</span></li>\n</ul>\n<p><b>Disclaimer:</b></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">The HUFT Tuxedo Harness is a Made To Order product</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Pet parents are requested to measure their dogs properly </span></li>\n</ul>",
