  "id": 2026565599294,
  "title": "HUFT Yakies Vegetarian Natural Chew Bone",
  "handle": "huft-yakies-vegetarian-organic-chew-bone",
  "description": "<p><strong>What are Yakie Chews and why is it good for my Dog?</strong><strong></strong></p>\n<p dir=\"ltr\">Give your pet something great to chew on! This Yakies Chew Bone is tough and perfect to strengthen your pet's gums and teeth. Made entirely of natural milk, it is 100% natural and devoid of preservatives. A healthy chew bone, it is high in calcium and in protein, making it a healthy treat for your pet.</p>\n<p><strong>Benefits of HUFT Yakies Chew Bones:</strong></p>\n<ul>\n<li>An all-natural recipe, 100% Natural</li>\n<li>Made from natural milk</li>\n<li>No preservatives or chemicals</li>\n<li>Low fat, high calcium and protein</li>\n<li>Gluten-free, Non-staining</li>\n<li>Healthier alternative to raw-hide bones</li>\n<li>Available in different sizes and weight.</li>\n</ul>\n<p><strong>Ingredients: </strong>Milk, Lime, Salt</p>\n<p><strong>Nutritional Information:</strong></p>\n<ul>\n<li>Crude Protein: 54.9%</li>\n<li>Crude Fat: 6.51%</li>\n<li>Crude Fibres: 0.9%</li>\n<li>Moisture: 10.3%</li>\n<li>Total Ash: 6.8%</li>\n</ul>\n<p><strong>Size &amp; Weight:</strong></p>\n<table style=\"border-collapse: collapse; width: 453px;\" width=\"320\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\" height=\"27\">\n<colgroup> <col style=\"width: 48pt;\" span=\"5\" width=\"64\"> </colgroup>\n<tbody>\n<tr style=\"height: 14.5pt;\" height=\"19\">\n<td style=\"height: 14.5pt; width: 89.3403px;\" class=\"xl65\" height=\"19\">Size</td>\n<td style=\"border-left: none; width: 89.2188px;\" class=\"xl65\">S</td>\n<td style=\"border-left: none; width: 89.2188px;\" class=\"xl65\">M</td>\n<td style=\"border-left: none; width: 89.2188px;\" class=\"xl65\">L</td>\n<td style=\"border-left: none; width: 89.3229px;\" class=\"xl65\">XL</td>\n</tr>\n<tr style=\"height: 14.5pt;\" height=\"19\">\n<td style=\"height: 14.5pt; border-top: none; width: 89.3403px;\" class=\"xl65\" height=\"19\">Weight</td>\n<td style=\"border-top: none; border-left: none; width: 89.2188px;\" class=\"xl65\">25g</td>\n<td style=\"border-top: none; border-left: none; width: 89.2188px;\" class=\"xl65\">60g</td>\n<td style=\"border-top: none; border-left: none; width: 89.2188px;\" class=\"xl65\">90g</td>\n<td style=\"border-top: none; border-left: none; width: 89.3229px;\" class=\"xl65\">110g</td>\n</tr>\n</tbody>\n</table>\n<div class=\"container\">\n<div class=\"container\">\n<div class=\"container\">\n<div style=\"text-align: center;\" class=\"resize\" data-mce-style=\"text-align: center;\">\n<p style=\"text-align: left;\" data-mce-style=\"text-align: left;\"> </p>\n<p style=\"text-align: left;\" data-mce-style=\"text-align: left;\">Made entirely of natural milk, Yakies are equal amounts nutritious and delicious. These natural chew bones are an ancient tried and tested recipe straight from the Himalayas. They are vegetarian, gluten-free and devoid of any preservatives, making them the perfect chew bar for your pet.</p>\n<p style=\"text-align: left;\" data-mce-style=\"text-align: left;\">Handcrafted in the Himalayas, the natural Milk Chews are carefully created keeping in mind the needs and health requirements of your dog. The cow cheese is smoke dried for a period of 35 days in order to make it hard and strong. The final product comes out so tough that your dog can chew on his natural vegetarian treat for a much longer period of time in comparison to other dental treats.</p>\n<p style=\"text-align: left;\" data-mce-style=\"text-align: left;\"><strong>Benefits:</strong></p>\n<div class=\"col-md-6\">\n<div class=\"resize\">\n<ul>\n<li style=\"text-align: left;\" data-mce-style=\"text-align: left;\">It is a long lasting chew so your pet will stay occupied for hours</li>\n<li style=\"text-align: left;\" data-mce-style=\"text-align: left;\">It is rich in protein and calcium</li>\n<li style=\"text-align: left;\" data-mce-style=\"text-align: left;\">It scrapes of plaque and tartar as your dog chews, promoting dental health</li>\n<li style=\"text-align: left;\" data-mce-style=\"text-align: left;\">Available in different sizes for different breeds</li>\n</ul>\n</div>\n</div>\n<div style=\"text-align: left;\" class=\"col-md-6\" data-mce-style=\"text-align: left;\">\n<strong>Description: </strong>Dogs enjoy chewing as it relaxes them and helps them unwind. You can give this chew to your pet when you like to keep them occupied and quiet for a little while. When they chew it down to a small piece, you can put it in the microwave for a few seconds, it will then become a crunchy piece that your dog can eat. Like all chews and toys, we recommend that this be given under pet parental supervision.</div>\n</div>\n<div class=\"col-md-12\">\n<p><strong>Why this is one of our most loved products</strong></p>\n<div class=\"resize\">\n<ul>\n<li>Dogs love to chew and its completely natural for them. Any pet parent will tell you that to keep your furniture and shoes safe, you must have chews or chew toys to give your dog.</li>\n<li>The Yakies chew bones were introduced as a safe, healthy alternative raw hide chews for dogs. If dogs swallow raw hide sticks, they can get stuck in their digestive systems and cause a block. Raw hide sticks are also processed with a lot of chemicals and this can be dangerous for dogs.</li>\n<li>The Yakies is tough and made in a range of different sizes for different breeds. Dogs love chewing on them and it keeps them occupied for hours. Chewing also helps dogs unwind and relax so they often fall asleep after a chew session.</li>\n</ul>\n</div>\n</div>\n</div>\n</div>\n</div>",
