  "description": "<p><span style=\"font-weight: 400;\">If you can vouch for the loyalty of your doggo, then the HUFT Marvel 2.0 Captain America harness is the best reward for them.</span></p>\n<p><span style=\"font-weight: 400;\">Straight out of the Marvel universe, this sturdy harness is specially made for your mighty superhero. The harness features the iconic Captain America logo. The neoprene fabric makes it water resistant while the mesh at the back makes it breathable. Simply secure with the snap buckle fastenings, adjust at the girth and neck and add their leash at the V-ring attachment. There is also a smaller loop on the front where you can add your pets ID tag.  To ensure safety in the dark, the harness has reflective tape detailing. </span></p>\n<p data-mce-fragment=\"1\"><strong>Features:</strong></p>\n<ul data-mce-fragment=\"1\">\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Harness in blue and red</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Features iconic Captain America logo</span></li>\n<li><span>Adjustable at the girth and neck</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Made with neoprene fabric in front</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Made with mesh fabric at the back</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Breathable, durable and water-resistant</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Easy to slip on</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Snap buckle closure</span></li>\n<li style=\"font-weight: 400;\">V-ring leash attachment at back<br>\n</li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Comes with an ID tag ring</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Reflective tape detailing for night reflection</span></li>\n</ul>\n<p data-mce-fragment=\"1\"><b data-mce-fragment=\"1\">Care Instructions: <span data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Gently wash with hand using mild a detergent.</span></b></p>\n<p><b>HUFT Tip:</b></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">We always recommend pet parental supervision when pets wear accessories</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Pair it with HUFT Captain America collar and leash for a matching set.</span></li>\n</ul>",
