  "description": "<p><strong><i>Show off your dog's superpower - turning hearts to mush with one boop!</i></strong></p>\n<p><span style=\"font-weight: 400;\">Does your pup's adorable wet nose give you a warm, fuzzy feeling? Share the cuteness in the HUFT Wet Nose, Warm Heart T-shirt!</span></p>\n<p><span style=\"font-weight: 400;\">This sunny yellow tee is made from a soft 60% cotton and 40% polyester blend that's lightweight and comfy for your dog to wear. The pull-over style features an adjustable toggle at the neckline for a secure fit. The high tummy cut allows for convenient pee breaks while you're out playing or walking. Le</span><span style=\"font-weight: 400;\">t your pup show off their boopable, heart-melting nose in this cheerful tee.</span></p>\n<p><strong><i>Colour Crush - It's a whole new vibe!</i></strong></p>\n<p><b>Features:</b></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Sleeveless t-shirt with a round neck</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Toggle at the neck for a snug fit</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Comfy &amp; easy to wear</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Does not hinder the dog's movement</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">High tummy cut for easy pee breaks</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Available in Medium to 5XL sizes</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Made in India, with love</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Suitable for all breeds</span></li>\n</ul>\n<p><b>Care Instructions:</b></p>\n<p><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Caring for this vest is easy -</span></p>\n<ul>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Hand wash/machine wash in cold water</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Dry flat in the shade</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Use warm iron</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Do not iron on print</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Do not bleach</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Do not wring</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Do not tumble dry.</span></li>\n</ul>\n<ul></ul>\n<ul data-mce-fragment=\"1\"></ul>",
