  "title": "HUFT Personalised Dog & Cat Name Tag - Heart - 3.5 cm x 3 cm",
  "handle": "huft-personalised-dog-cat-name-tag-heart-3-5-cm-x-3-cm",
  "description": "<p>Get your pet an added safety measure to help him get back home if he ever wanders away. This heart-shaped pet name tag for dogs and cats is customizable to add in vital contact information to ensure your pet can be found if he was ever lost.</p>\n<p>Our brass tags are chrome plated on one side and unfinished silver on the other so that they can be engraved. Long-lasting and strong these dog tags are an absolute MUST HAVE for every pet! All our tags come with a metal ring that can be used to attach the tag to the dog's collar. Available in multiple colors!</p>\n<p><strong>Features:</strong></p>\n<ul>\n<li>\n<strong>Size: </strong>3.5 cm x 3 cm</li>\n<li>\n<strong>Shape:</strong> Heart</li>\n<li>\n<strong>Material:</strong> Brass with chrome coating on one side and <span>unfinished silver on the other</span>\n</li>\n<li>Long-lasting and string</li>\n<li><span>Comes with a metal ring that can be used to attach the tag</span></li>\n</ul>\n<p><strong>How to Personalize: </strong>To personalize this name tag, please add your pet's name in the field - \"Front Text\", and your contact details in the field - \"Back Text\".<br></p>\n<p><strong><br></strong><strong>HUFT Tip: </strong>Personalized name tags cannot be returned or exchanged</p>",
