  "description": "<p data-mce-fragment=\"1\"><span style=\"font-weight: 400;\">Don't let the rain stop you and your pet from enjoying the great outdoors because the HUFT Magical Mist Dog Raincoat will keep them safe.</span></p>\n<p data-mce-fragment=\"1\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><b><i>Trust us, it is brighter and better</i></b><i>!</i></span></p>\n<p data-mce-fragment=\"1\"><span style=\"font-weight: 400;\">This classic combination of light blue and pink is something you have never seen before. </span><i><span style=\"font-weight: 400;\">Now, there is no excuse to skip your daily walk with your furry friend just because it's raining.</span></i></p>\n<p data-mce-fragment=\"1\"><i><span style=\"font-weight: 400;\">With this raincoat made from 100% polyester, your dog's coat will stay dry and protected. </span></i></p>\n<p data-mce-fragment=\"1\"><span style=\"font-weight: 400;\">It has been designed to fit snugly with a velcro closure on the front to ensure proper coverage. Additionally, there are toggles on the hood, sleeves, and bottom hem for easy adjustability of the raincoat.</span></p>\n<p data-mce-fragment=\"1\"><span style=\"font-weight: 400;\">Your dog's safety is paramount, and that's why we have added a reflective strip at the centre of the back for night walks.</span></p>\n<p data-mce-fragment=\"1\"><span style=\"font-weight: 400;\">The leash opening on the back of the neck comes with flaps to prevent water from seeping in, giving you peace of mind while taking your furry friend out in rainy weather.</span></p>\n<p data-mce-fragment=\"1\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><i><b>Colour Crush - It's a whole new vibe</b></i></span></p>\n<p data-mce-fragment=\"1\"><b data-mce-fragment=\"1\">Here is what makes it the best pick for your dog:</b></p>\n<ul data-mce-fragment=\"1\">\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Made from waterproof material</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Toggle adjustability on the hood, sleeves and bottom hem</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Velcro closure in the front</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Leash opening for collar access</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Reflective strip at the back</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Easy to wear</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Comes with a pouch for storage</span></li>\n</ul>\n<p><b>Sizing Reference:</b></p>\n<ul>\n<li>The model Donut (Golden Retriever) in the picture is wearing size 4XL<br>\n</li>\n<li><span>The model Snuggles (Cocker spaniel) in the picture is wearing size 2XL.</span></li>\n</ul>\n<p data-mce-fragment=\"1\"><strong><b data-mce-fragment=\"1\">How to care for your dog's new raincoat</b>:</strong></p>\n<ul data-mce-fragment=\"1\">\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Wash separately on a gentle cycle in cold water</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Wash inside out</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Do not tumble dry</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Do not iron</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Do not bleach</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Do not wring</span></li>\n</ul>\n<p data-mce-fragment=\"1\"><strong>HUFT Tip :</strong></p>\n<ul data-mce-fragment=\"1\">\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">If your pet's coat gets wet, be sure to dry it out thoroughly as soon as you get home</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">We always recommend pet parental supervision when pets are wearing accessories.</span></li>\n</ul>",
