  "description": "<p data-mce-fragment=\"1\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Who says the rainy season has to be grey and gloomy? Perk up your surroundings with the HUFT Neon Shower Dog Raincoat. </span></p>\n<p data-mce-fragment=\"1\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><b><i>Trust us, it is brighter and better</i></b><i>!</i></span></p>\n<p data-mce-fragment=\"1\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><i>This striking combination of neon green and pink is sure to turn heads.</i></span></p>\n<p data-mce-fragment=\"1\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><i>Now, there is no excuse to skip your daily walk with your furry friend just because it's raining.</i></span></p>\n<p data-mce-fragment=\"1\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><i>Made from 100% polyester, this raincoat keeps your dog's coat dry. To ensure the raincoat fits perfectly there is an adjustable buckle at the girth. For proper coverage, we have added velcro closure at the front neck and the toggles at the neck ensure proper adjustability of the hood. </i></span></p>\n<p data-mce-fragment=\"1\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><i>For your dogs comfort, we have added comfortable elastic bands for the hind legs, so the raincoat does not shift side to side while walking. </i></span><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><i>And we know, your dog's safety is your priority. There is reflective piping at the back for safe night walks and the leash opening at the back of the neck comes with flaps to prevent water from seeping in. </i></span></p>\n<p data-mce-fragment=\"1\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><i><b>Colour Crush - It's a whole new vibe</b></i></span></p>\n<p data-mce-fragment=\"1\"><b data-mce-fragment=\"1\">Here is what makes it the best pick for your dog:</b></p>\n<ul data-mce-fragment=\"1\">\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Made from waterproof material</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Comes with a toggle for adjustable hood</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Has a velcro closure at the neck in the front</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Adjustable girth with buckle closure in the front</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Leash opening for collar access</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Reflective piping at the back</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Elastic for hind leg grip</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Easy to wear</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Comes with a pouch for storage</span></li>\n</ul>\n<p><b>Sizing Reference:</b></p>\n<ul>\n<li>The model Tim Tim (Shih Tzu) in the picture is wearing size L<br>\n</li>\n<li><span>The model Pepsi (Labrador/Indie) in the picture is wearing size 3XL.</span></li>\n</ul>\n<p data-mce-fragment=\"1\"><strong>HUFT Tip :</strong></p>\n<ul data-mce-fragment=\"1\">\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">If your pet's coat gets wet, be sure to dry it out thoroughly as soon as you get home</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">We always recommend pet parental supervision when pets are wearing accessories.</span></li>\n</ul>\n<p data-mce-fragment=\"1\"><strong>Care Instructions :</strong></p>\n<ul data-mce-fragment=\"1\">\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Wash separately on a gentle cycle in cold water</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Wash inside out</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Do not tumble dry</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Do not iron</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Do not bleach</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Do not wring</span></li>\n</ul>",
