  "handle": "kong-classic-dog-toy",
  "description": "<p>The Kong Classic has been around for decades and stands as the gold standard for dog toys. This ultra-durable treat-dispensing toy is made from natural rubber and is suitable for average chewers. A mentally stimulating toy, it helps satisfy your dog's need to play. It can be stuffed with their favourite treats to make playtime more enticing and keep them occupied. Your dog will love the unpredictable bounce and treats.</p>\n<p><strong>Return &amp; exchange policy:</strong> Once bought, our toys are not eligible for exchange, returns or refunds. If you have received a damaged product, do get in touch so we can send you a replacement.<br></p>\n<p><strong>Features:</strong></p>\n<ul>\n<li>Suitable for average chewers</li>\n<li>Made from natural rubber</li>\n<li>Unpredictable bounce</li>\n<li>Stuff with treats to extend playtime</li>\n</ul>\n<p><strong>Dimensions:</strong></p>\n<table width=\"781\">\n<tbody>\n<tr>\n<td width=\"203\" style=\"text-align: center;\"><strong>Size</strong></td>\n<td width=\"277\" style=\"text-align: center;\"><strong>Inch</strong></td>\n<td width=\"301\" style=\"text-align: center;\"><strong>Cm</strong></td>\n</tr>\n<tr>\n<td style=\"text-align: center;\">Extra Small</td>\n<td style=\"text-align: center;\">2.5 x 1.4 x 1</td>\n<td style=\"text-align: center;\">6.4 x 3.6 x 2.5</td>\n</tr>\n<tr>\n<td style=\"text-align: center;\">Small</td>\n<td style=\"text-align: center;\">3 x 1.75 x 1.5</td>\n<td style=\"text-align: center;\">7.6 x 4.4 x 3.8</td>\n</tr>\n<tr>\n<td style=\"text-align: center;\">Medium</td>\n<td style=\"text-align: center;\">3.5 x 2.25 x 2</td>\n<td style=\"text-align: center;\">8.9 x 5.7 x 5.1</td>\n</tr>\n<tr>\n<td style=\"text-align: center;\">Large</td>\n<td style=\"text-align: center;\">4 x 2.75 x 2.75</td>\n<td style=\"text-align: center;\">10.2 x 7.0 x 7.0</td>\n</tr>\n<tr>\n<td style=\"text-align: center;\">Extra Large</td>\n<td style=\"text-align: center;\">5 x 3.5 x 3</td>\n<td style=\"text-align: center;\">12.7 x 8.9 x 7.6</td>\n</tr>\n</tbody>\n</table>\n<p><strong>Pet parents, please note</strong></p>\n<ul>\n<li>Always buy size appropriate toys for your pet</li>\n<li>We always recommend pet parental supervision when pets are playing with toys</li>\n<li>Remember to put the toy away after playtime</li>\n<li>No toy is indestructible in nature. Please keep away from pet if you see any signs of wear and tear.</li>\n</ul>\n<ul></ul>\n<p><strong>HUFT Tip:</strong> On a hot day, you could also stuff it with peanut butter and freeze it. Your pet will patiently lick every last bit out.</p>\n<p><strong>Please Note:</strong>There might be variance in color and style. Please allow us to choose for you.</p>",
