  "description": "<p><strong><i>Make every day a snuggle day with the cosy HUFT Cuddle Buddy T-shirt.</i></strong></p>\n<p><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Your dog can flaunt being the number cuddle buddy in this perfect tee.Made from a soft 60% cotton and 40% polyester blend, this lightweight fabric ensure it's comfortable for your dog to wear and move freely in.</span></p>\n<p><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">The pull-over style features an adjustable toggle at the neckline for a secure, custom fit. The high tummy cut allows for easy pee breaks while you're out exploring together. Breathable and easy to wear, this t-shirt is great for lounging, cuddling at home or strolling around town.</span></p>\n<p><strong><i>Colour Crush - It's a whole new vibe!</i></strong></p>\n<p><b>Features:</b></p>\n<ul>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Sleeveless t-shirt with a round neck</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Toggle at the neck for a snug fit</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Comfy &amp; easy to wear</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Does not hinder the dog's movement</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">High tummy cut for easy pee breaks</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Available in Medium to 5XL sizes</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Made in India, with love</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Suitable for all breeds</span></li>\n</ul>\n<p><b>Care Instructions:</b></p>\n<p><span style=\"font-weight: 400;\">Caring for this vest is easy -</span></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Hand wash/machine wash in cold water</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Dry flat in the shade</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Use warm iron</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Do not iron on print</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Do not bleach</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Do not wring</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Do not tumble dry.</span></li>\n</ul>\n<ul></ul>\n<ul data-mce-fragment=\"1\"></ul>",
