  "id": 4110222655550,
  "title": "HUFT Orthopedic Dog Bed with Cushion (Free Bone Cushion) - Red and Teal Blue (Made to Order)",
  "handle": "huft-orthopedic-dog-bed-with-cushion-free-bone-cushion-red-and-teal-blue-made-to-order",
  "description": "<p>Orthopedic beds offer a medium-soft to firm support and are great for dogs that suffer from arthritis, joint pains, back/spinal problems and even senior dogs. This multi-layered mattress has a firm layer at the bottom to support your dog's back and a plush layer at the top to offer loads of comfort. This 2-way mattress can be flipped for a firm or plush support.</p>\n<p><span></span>Suitable for optimal back support<br><span></span>Self-adjusting foam adapts to the shape of the spine<br><span></span>Two way use - firm and plush support depending on your dog's comfort level<br><span></span>Open celled HR foam ensures maximum comfort without any pressure point formation<br><span></span>Ideal for dogs with arthritis, joint pains, back/spinal issues and even senior dogs</p>\n<p><strong>Sizes:</strong></p>\n<ul>\n<li><span>Small: 86.3 X 66 X 7.6 cm</span></li>\n<li>Medium: 101.6 X 76.2 X 7.6 cm</li>\n<li><span>Large: 121.9 X 88.9 X 7.6 cm</span></li>\n<li><span>Extra Large: 132 X 106.6 X 7.6 cm</span></li>\n</ul>\n<p>Ships within 12-15 days from the warehouse</p>\n<h3><strong>Orthopedic Beds</strong></h3>\n<p>The Orthopedic Beds by Heads Up For Tails have been carefully thought out to offer complete orthopedic support. They are specially designed so that senior doggies can put their paws up and get to get the rest they need.</p>\n<p><strong>What makes them so special?</strong></p>\n<p><strong>Firm, supportive core: </strong>It is made with two technically devised layers of foam. The supportive core or the base of the bed consists of self-adjusting compressed resin bonded foam. This offers optimum and firm support for your dogs back and keeps the spine aligned to his or her natural posture.</p>\n<p><strong>Plush, high-resilience foam: </strong>The top layer is made with a high resilience foam which is open celled and web ventilated. This is the softer layer that helps cushion the body and relieves pressure from the muscles and joints.</p>\n<p><strong>Aero sleep technology for optimum temperatures: </strong>Additionally, this high resilience foam is based on aero sleep technology which adjusts in relation to surrounding temperatures and weather conditions to arrive at the optimum temperature. This means that whether it is a hot day or not, your dog will be able to sleep comfortably without worrying about excessive heating.</p>\n<p>So, if your golden oldie has severe back aches, you can flip the bed to have the firm side on top and give your dog adequate support. Otherwise, you can have the plush side on top so your dog keeps cool and still gets enough firm, support.</p>\n<p><strong>Easy on you and your dog: </strong>Besides the special foam technologies, these beds have been purposely made to be low-lying. This way, dogs can just step on to the bed with ease. The cover is removable and can be washed in the machine which is useful if your dog (as senior dogs often do) has incontinence. You can also buy a spare cover.</p>\n<p>These Orthopedic Beds were primarily made for senior dogs but have proved helpful for doggies of any age who suffer from joint and back issues.</p>\n<p><strong>Text for the tags on the Orthopedic Beds: </strong>Made for senior doggies to snooze comfortably, this bed provides complete orthopedic support. The firm core and base layer support the back while the plush, high-resilience foam on top relieves joint &amp; muscle pressure. For dogs with chronic back problems, flip it over to have the firm side facing up.</p>",
