  "description": "<style type=\"text/css\"><!--\ntd {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}\n--></style>\n<p><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">When you head out for a walk, let your dog flaunt their easy to wear dog harness. </span>The HUFT Easy On Harness for dogs is durable and padded for comfort. Adjustable at two different points, it is simple to arrive at the perfect fit. Its reflective webbing enhances safety in low light conditions. Leash-to-harness attachment is available.</p>\n<p><strong>Features:</strong></p>\n<ul>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Breathable 3D mesh padding <br>\n</li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Quick release buckles for easy closure </span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Adjustable neck and chest straps </span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Handle for safety and support, made of soft neoprene padding </span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Reflective nylon webbing </span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Leash attachment for convenience</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Strong and durable hardware </span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Easy to wash </span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Suitable for dogs of medium and large breeds</span></li>\n</ul>\n<p><strong>HUFT Tip: </strong>Suitable for all breeds, it is ideal for dogs who love outdoor activity.</p>\n<p><b>How to put on this dog harness? </b></p>\n<p><b>Step 1: </b><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Open the quick release buckles. Slip the harness on with the logo appearing at the back.</span></p>\n<p><b>Step 2: </b><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Close the velcro &amp; click the snap buckles close. Adjust harness to your pet is comfort.</span></p>\n<p><b>Step 3:</b><br></p>\n<ul>\n<li><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Attach your pet is leash to the ring </span></li>\n<li><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Use the handle to restrain your dog</span></li>\n</ul>\n<style type=\"text/css\"><!--\ntd {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}\n--></style>\n<style type=\"text/css\"><!--\ntd {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}\n--></style>",
