  "description": "<p> <br></p>\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://cdn.shopify.com/s/files/1/0086/0795/7054/files/Happi_Doggy-_EBC-02_1024x1024.jpg?v=1600865517\" alt=\"\"></p>\n<p>Happi Doggy dental chews are made to prevent plaque build-up and remove tartar stains. This treat is 100% meat free and is fortified with Perilla and eucalyptus oil. Orange is a good source of vitamin C and maintains collagen in your pet's gums. This treat is full of natural minerals that will help strengthen the immune system and even aid in easing chronic pain in arthritic canines.</p>\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://cdn.shopify.com/s/files/1/0086/0795/7054/files/Happi_Doggy-_EBC-12_480x480.jpg?v=1600865752\" alt=\"\"></p>\n<p><strong>Features:</strong></p>\n<ul>\n<li>Orange provides vitamin C<br>\n</li>\n<li>Prevents plaque build-up and removes tartar stains</li>\n<li>Treat size: 2.5 Inch<br>\n</li>\n<li>Pack contains: 18 pieces</li>\n<li>Grain-free, gluten treats</li>\n<li>Aids dental hygiene</li>\n<li>Plant-based ingredients</li>\n<li>Zest range has treats fortified with Perilla and Eucalyptus oil</li>\n<li>Suitable for all life stages and breeds</li>\n<li>No meat, meat by-products or filler ingredients</li>\n<li>Specially designed with bristles to scrape off plaque and tartar</li>\n</ul>\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://cdn.shopify.com/s/files/1/0086/0795/7054/files/Happi_Doggy-_EBC-06_480x480.jpg?v=1600865532\" alt=\"\"></p>\n<p><strong>Ingredients: </strong>Tapioca starch, Powdered cellulose, Pea flour, Glycerin, Apple fibre, Sodium caseinate, Lactobacillus acidophilus, Calcium citrate, Sodium hexametaphosphate, Lecithin, Orange powder, Perilla extract, Prebiotics, Yeast cell wall polysaccharide, Sunset yellow, Eucalyptus Oil.<br><strong></strong></p>\n<p><strong>Precautions:</strong><br></p>\n<ul>\n<li>Check ingredients for possible allergens</li>\n<li>Always check with a vet before you alter your pet's diet</li>\n<li>Always have clean water available for your pet</li>\n</ul>\n<p><strong>HUFT Tip: </strong>Dental health is often neglected by pet parents but its very important for your dogs overall health. If periodontal diseases are not countered, it can lead to a number of more serious health issues. The bacteria can enter the bloodstream and affect major organs. Besides brushing their teeth, giving dogs dental chews and treats help keep their pearly whites in good shape. The number of treats you can give your pet per day depends on the size of your dog and the size of the treat. As a rule of thumb, it is recommended that your pet's treats be no more than 10% of their daily calorie intake.</p>\n<p><strong>Happi Doggy Dog Treats has a lot more to offer. <a href=\"https://headsupfortails.com/collections/happi-doggy\" target=\"_blank\">Click here</a> to find out.</strong></p>\n<style><!--\n.resize\n{\nfont-size: 18px;\n}\n--></style>",
